import "./App.css";
import Navbar from "./component/Navbar";
import MainSection from "./pages/MainSection";

import { Route, Routes } from 'react-router-dom';


function App() {
  return (

    <div className="App">
      <Navbar></Navbar>
      <MainSection />
      <Routes>

<Route path='/products'>
  <Products/></Route>
</Routes>
    </div>
  );
}

export default App;
